import React, { useEffect } from 'react';
import './homepage.css';
import script from './script.js';

const Homepage = ({ setLoginUser }) => {
  useEffect(() => {
    script(); // Call the script function when the component mounts
  }, []);

  const handleSearch = (query) => {
    // Perform search functionality here
    // You can replace this with your desired implementation
    console.log(`Performing search for query: ${query}`);
  };

  return (
    <div className="homepage">
      <header>
        <img src="./logo.png" width="120px" />

        <div className="inputSearch desktop">
          <form id="searchForm">
            <input type="text" placeholder="Type to search..." id="searchInput" />
            <span> <i className="fa-solid fa-search"></i></span>
          </form>
        </div>
        <nav className="desktop">
          <ul>
            <li onClick={() => handleSearch('ipl2023')}>IPL 2023</li>
            <li onClick={() => handleSearch('tech')}>Tech</li>
            <li onClick={() => handleSearch('food')}>Food</li>
            <li onClick={() => handleSearch('movies')}>Movies</li>
            <li onClick={() => handleSearch('business')}>Business</li>
          </ul>
        </nav>

        <div className="menuBtn">
          <i className="fa-solid fa-bars"></i>
        </div>

        <div className="mobile hidden">
          <nav>
            <ul>
              <li onClick={() => handleSearch('ipl2023')}>IPL 2023</li>
              <li onClick={() => handleSearch('tech')}>Tech</li>
              <li onClick={() => handleSearch('food')}>Food</li>
              <li onClick={() => handleSearch('movies')}>Movies</li>
              <li onClick={() => handleSearch('business')}>Business</li>
            </ul>
          </nav>
          <div className="inputSearch">
            <form id="searchFormMobile">
              <input type="text" placeholder="Type to search..." />
              <span> <i className="fa-solid fa-search"></i></span>
            </form>
          </div>
        </div>
      </header>

      {/* main section */}
      <main></main>

      {/* <script src="script.js"></script> */}
    </div>
  );
};

export default Homepage;
